import React, { Component } from "react";
import Button from "react-bootstrap/Button";
import "../App.css";
export default class Card extends Component {
  state = {};
  componentDidMount = () => {};
  constructor(props) {
    super();
  }
  render() {
    const mystyle = {
      margin: "0.5%",
      padding: "0.5%",
      width: "10%",
      color: "black",
      backgroundColor: "gray",
      fontFamily: "Arial",
    };
    return (
      <Button className="bbb" style={mystyle}>
        {this.props.val}
      </Button>
    );
  }
}
